/**
 * @file mip-st-scroll 组件模板
 * @author liyinan
 */

define(function (require) {
    /* eslint-disable */
    var noDataImg = 'background-image: url(data:image/png;base64,);';
    return '<mip-st-infinitescroll data-src="#url#" template="orderTemplate">                  '
        + '    <script type="application/json">                                                '
        + '    {                                                                               '
        + '        "rn": "Infinity",                                                           '
        + '        "pn": 1,                                                                    '
        + '        "prn": 6,                                                                   '
        + '        "pnName": "pn",                                                             '
        + '        "bufferHeightPx": 300,                                                      '
        + '        "timeout": 5000,                                                            '
        + '        "loadingHtml": "<div class=\\"logo\\"><div class=\\"flash\\"></div></div>", '
        + '        "loadFailHtml": "数据加载失败",                                             '
        + '        "noMoreDataHtml": "<div class=\\"mip-st-scroll-no-data\\"><div class=\\"mip-st-scroll-no-data-img\\" style=\\"' + noDataImg + '\\"></div><div class=\\"mip-st-scroll-no-data-text\\">暂无内容</div></div>",'
        + '        "loadOverHtml": ""                                                          '
        + '    }                                                                               '
        + '    </script>                                                                       '
        + '    <template type="mip-etpl" id="orderTemplate">                                   '
        + '        <li class="st-order-item">                                                  '
        + '            <div class="st-info">                                                   '
        + '                <mip-img class="st-avatar" src="{{avator}}"></mip-img>              '
        + '                <div class="st-name">{{name}}</div>                                 '
        + '                <mip-st-star value="{{rating}}" field="star" total="5" size="9">    '
        + '                </mip-st-star>                                                      '
        + '            </div>                                                                  '
        + '            <div class="st-content">                                                '
        + '                <div class="st-content-text">{{content}}</div>                      '
        + '                {% if: {{image_num}} != 0 %}                                        '
        + '                <div class="st-content-imgs">                                       '
        + '                {% for: {{image_list}} as {{image}}, {{index}} %}                   '
        + '                    <div class="pic-thumb-con">                                     '
        + '                        <div class="pic-thumb-wrapper">                             '
        + '                            <div style="background-image: url({{image.thumbnails}})"'
        + '                                original="{{image.original}}"                       '
        + '                                class="pic-thumb"></div>                            '
        + '                        </div>                                                      '
        + '                    </div>                                                          '
        + '                {% /for %}                                                          '
        + '                </div>                                                              '
        + '                {% /if %}                                                           '
        + '            </div>                                                                  '
        + '            <div class="st-date">                                                   '
        + '                {{time}}{% if:{{spu_name}} %} <span class="mip-infinitescroll-date-type">{{spu_name}}</span>{% /if %}                '
        + '            </div>                                                                  '
        + '        </li>                                                                       '
        + '    </template>                                                                     '
        + '    <div class="mip-infinitescroll-results"></div>                                  '
        + '    <div class="bg">                                                                '
        + '        <div class="mip-infinitescroll-loading"></div>                              '
        + '    </div>                                                                          '
        + '</mip-st-infinitescroll>                                                            ';
});
